import React from 'react';
import Divider from "@material-ui/core/Divider";
import {makeStyles} from "@material-ui/core/styles";
import {useStyles} from "../_layouts/default/LayoutUseStyles";
import Paper from "@material-ui/core/Paper";
import auth from '../../../auth'
import Footer from "../_layouts/_includes/Footer";

const useLocalClasses = makeStyles(theme => ({
    papers: {
        display: 'flex',
        flexWrap: 'wrap',
        '& > *': {
            margin: theme.spacing(1),
            width: theme.spacing(16),
            height: theme.spacing(16),
        },
    },
}));


export default function Home(props) {
    const classes = useStyles();
    const cls = useLocalClasses();

    return (
        <div className={classes.root}>

            <div className={classes.wrapper}>
                <div className={classes.content}>
                    <div>
                        <h1>Предложи свою идею для создания композиции или зацени уже имеющиеся!</h1>
                    </div>
                    <div>
                        <button onClick={() => {
                            auth.login(() => {
                                props.history.push("/compositions")
                            })
                        }}>Login
                        </button>
                    </div>
                    <Divider variant="middle"/>
                    <main>
                        <div className={cls.papers}>
                            <Paper elevation={3} />
                            <Paper elevation={3} />
                        </div>
                    </main>
                </div>
                <Footer />
            </div>
        </div>
    );
}
